import React, { useState } from 'react';
import PersonOutlineIcon from '@mui/icons-material/PersonOutline';
import MenuIcon from '@mui/icons-material/Menu';
import CloseIcon from '@mui/icons-material/Close';
import Logo from '../../assets/logo/logo.png';
import NavLinks from './Navlinks';
import DraftsIcon from '@mui/icons-material/Drafts';
import PhoneEnabledIcon from '@mui/icons-material/PhoneEnabled';
import MapsHomeWorkIcon from '@mui/icons-material/MapsHomeWork';
import FacebookIcon from '@mui/icons-material/Facebook';
import InstagramIcon from '@mui/icons-material/Instagram';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import TwitterIcon from '@mui/icons-material/Twitter';
function Navbar() {
	const [open, setOpen] = useState(false);
	return (
		<>
		<div className='flex flex-col lg:flex-row hidden '>

				<div className='flex justify-between bg-blue-300 w-[80%] p-2'>
					<span className="flex items-center gap-2">
						<PhoneEnabledIcon />
						<li className="md:text-sm text-xsm mb-2">+8801888042370</li>
					</span>
					<span className="flex items-center gap-2">
						<DraftsIcon />
						<li className="md:text-sm text-xsm mb-2">
							sales@amrextherapypm.com</li>
					</span>
					<span className="flex items-center gap-2">
						<MapsHomeWorkIcon />
						<li className="md:text-sm text-xsm mb-2">205, 48th ST, APT2, Union City, NJ-07087</li>
					</span>
				</div>
				<div>
					<div className='flex justify-between bg-red-500 gap-14 p-3'>
						<FacebookIcon /><InstagramIcon /> <LinkedInIcon /><TwitterIcon />
					</div>
				</div>
				

		</div>
		
			<nav className="bg-primary lg:text-white text-black sticky top-0 w-full z-50">
				<div className="container mx-auto flex items-center font-medium justify-between">
					<div className="z-50 p-5 lg:w-auto w-full flex justify-between">
						<img src={Logo} alt="logo" className="lg:cursor-pointer h-10" />
						<div className="text-3xl lg:hidden" onClick={() => setOpen(!open)}>
							{open ? <CloseIcon className="text-white" /> : <MenuIcon className="text-white" />}
						</div>
					</div>
					<ul className="lg:flex hidden items-center gap-3 font-[Poppins]">
						<NavLinks />
						<div class="flex items-center">
							<button type="button" class="inline-block px-6 py-2 bg-blue-600 text-white font-medium text-sm leading-tight uppercase rounded shadow-md hover:bg-blue-700 hover:shadow-lg focus:bg-blue-700 focus:shadow-lg focus:outline-none focus:ring-0 active:bg-blue-800 active:shadow-lg transition duration-150 ease-in-out">
								
								<PersonOutlineIcon />Login</button>
						</div>
					</ul>

					{/* Mobile nav */}
					<ul
						className={`
        lg:hidden bg-white fixed w-full top-20 overflow-y-auto bottom-0 py-5 pl-4
        duration-500 ${open ? 'left-0' : 'left-[-100%]'}
        `}
					>
						<NavLinks />
					</ul>
				</div>
			</nav>
		</>
	);
}

export default Navbar;
